import React, { Component } from "react";

export default class Header extends Component {
  render() {
    const L = {
      fontSize: "40px",
      background: "-webkit-linear-gradient(darkgrey, black, orange)",
      webkitBackgroundClip: "text",
      webkitTextFillColor: "transparent"
    };
    const A = {
      color: "#847c78",
      fontSize: "60px"
    };
    const H = {
      color: "#928a82",
      fontSize: "60px"
    };
    const u = {
      color: "#b3afa5",
      fontSize: "60px"
    };
    const g = {
      color: "#d4d4c8",
      fontSize: "60px"
    };
    const h = {
      color: "#deccd6",
      fontSize: "60px"
    };
    const e = {
      color: "#e7c3e4",
      fontSize: "60px"
    };
    const s = {
      color: "#e6c392",
      fontSize: "60px"
    };
    const M = {
      color: "#e5c33f",
      fontSize: "60px"
    };
    const u2 = {
      color: "#b1a061",
      fontSize: "60px"
    };
    const s2 = {
      color: "#7c7c83",
      fontSize: "60px"
    };
    const i = {
      color: "#8e8e91",
      fontSize: "60px"
    };
    const c = {
      color: "#9f9f9f",
      fontSize: "60px"
    };
    return (
      <div className="header navbar-wrapper">
        <nav className="navbar">
          <a className="navbar-brand" href="#">
            <div className="">
              <span style={L}>L</span>
              <span style={A}>A</span>
              <span style={H}>H</span>
              <span style={u}>u</span>
              <span style={g}>g</span>
              <span style={h}>h</span>
              <span style={e}>e</span>
              <span style={s}>s</span>
              <span style={M}>M</span>
              <span style={u2}>u</span>
              <span style={s2}>s</span>
              <span style={i}>i</span>
              <span style={c}>c</span>
            </div>
          </a>
          <button
            className="navbar-toggler"
            type="button"
            data-toggle="collapse"
            data-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>

          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav mr-auto">
              <li className="nav-item active">
                <a className="nav-link" href="#">
                  Home <span className="sr-only">(current)</span>
                </a>
              </li>
              <li className="nav-item">
                <a className="nav-link" href="#">
                  Link
                </a>
              </li>
              <li className="nav-item">
                <a
                  className="nav-link disabled"
                  href="#"
                  tabindex="-1"
                  aria-disabled="true"
                >
                  Disabled
                </a>
              </li>
            </ul>
          </div>
        </nav>
      </div>
    );
  }
}
